// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './components/Home';
import Register from './components/Register';
import AdminPanel from './components/AdminPanel';
import OpenComplaints from './components/OpenComplaints';
import SolvedComplaints from './components/SolvedComplaints';
import UserComplaints from './components/UserComplaints';
import CreateComplaint from './components/CreateComplaint';
import Tabs from './components/Tabs';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/register">
          <Register />
        </Route>
        <Route path="/adminPanel">
          <AdminPanel />
        </Route>
        <Route path="/openComplaints">
          <OpenComplaints />
        </Route>
        <Route path="/solvedComplaints">
          <SolvedComplaints />
        </Route>
        <Route path="/userComplaints">
          <UserComplaints />
        </Route>
        <Route path="/createComplaint">
          <CreateComplaint />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
